def get_missing_values_codes(df, feature, str_list):
    if df[feature].dtype == np.object:
        return str_list.replace('[', '').replace(']', '').split(',')
    else :
        return ast.literal_eval(str_list)

def process_feature_missing_values_codes(df, feat_info):
    for feature, str_list in zip(feat_info['attribute'], feat_info['missing_or_unknown']):
        missing_values_code_list = get_missing_values_codes(df, feature, str_list)
        if len(missing_values_code_list) > 0:
            #print('feature=', feature, 'missing_values_code_list=', missing_values_code_list)
            df[feature].replace(missing_values_code_list, np.nan, inplace=True)
    return df

def get_missing_values_prop(df):
    missingvalues_prop = (df.isnull().sum()/len(df)).reset_index()
    missingvalues_prop.columns = ['column_name','missing_proportion']
    return missingvalues_prop.sort_values(by = 'missing_proportion', ascending = False)

def get_features_types(df, feat_info):
    multi_cat = []
    binary_cat = []
    mixed = []
    for feature in df.columns:
        feat_type = feat_info[feat_info['attribute']==feature].type.item()
        num_cat = len(pd.value_counts(df[feature]))
        if feat_type == 'categorical':
            if num_cat == 2:
                binary_cat.append(feature)
            else:
                multi_cat.append(feature)
        elif feat_type == 'mixed':
            mixed.append(feature)
    return multi_cat, binary_cat, mixed

def engineer_cat_features(df, feat_info):
    multi_cat, binary_cat, mixed = get_features_types(df, feat_info)
    dummy_feat = multi_cat.copy()
    for bin_cat in binary_cat:
        if df[bin_cat].dtype == np.object:
            dummy_feat.append(bin_cat)

    for dum_col in dummy_feat:
        df[dum_col] = df[dum_col].astype('category')
    data_dummy_feat = pd.get_dummies(df[dummy_feat])
    df = df.drop(dummy_feat, axis = 1)
    df[data_dummy_feat.columns] = data_dummy_feat
    return df

